function SideVideo(props) {
  return (
    <li className="side-video">
      <img
        className="side-video__img"
        src={this.props.image}
        alt="first video"
      />
      <h2 className="side-video__title">{this.props.title}</h2>
      <h4 className="side-video__channel">{this.props.channel}</h4>
    </li>
  );
}

export default SideVideo;
